import React, { Component } from "react";
import ReactPlayer from "react-player";

class IntroVideo extends Component {
  render() {
    return (
      <div style={{ borderRadius: "40px" }}>
        <ReactPlayer
          url="./video.mp4"
          playing="true"
          loop="true"
          width="25rem"
          height="auto"
        />
      </div>
    );
  }
}

export default IntroVideo;
